    void GenerateGridFromKey(char[,] key)
    {
        //g = ground
        //w = wall
        //c = center

        //Debugging
        if (debugging)
        {
            for (int h = 0; h < gridSize; h++)
            {
                string ans = "";
                for (int w = 0; w < gridSize; w++)
                {
                    ans += gridKey[w, h] + " ";
                }
                print(ans);
            }
        }

        //Tile Instantiation from Key
        for (int h = 0; h < gridSize; h++)
        {
            for (int w = 0; w < gridSize; w++)
            {
                GameObject currentTile = null;
                switch (gridKey[h, w])
                {
                    case 'g': currentTile = grass; break;
                    case 'R': currentTile = road; break;
                    case 'b': currentTile = road; break;
                    case 't': currentTile = road; break;
                    case 'p': currentTile = gardenPath; break;
                    case 'G': currentTile = gardenTile; break;
                    case 'f': currentTile = floor; break;
                    case 'm': currentTile = manorSpace; break;
                    case 'v': currentTile = hedgeVert; break;
                    case 'h': currentTile = hedgeLat; break;
                    case '7': currentTile = hedgeULCorn; break;
                    case '9': currentTile = hedgeURCorn; break;
                    case '1': currentTile = hedgeBLCorn; break;
                    case '3': currentTile = hedgeBRCorn; break;

                    case 's': currentTile = shrub; break;

                    case '0': currentTile = null; break;
                }

                if ((currentTile == grass || currentTile == gardenTile ) && rand.Next(1,129) % 8 == 0)
                    currentTile = flowers;

                if (currentTile == road && (h == 0 || w == 0 || h == gridSize-1 || w == gridSize-1))
                {
                    string place = "Center";
                    GameObject newDoor = Instantiate(door, new Vector3(w, h, 0f), Quaternion.identity) as GameObject;

                    if (h == gridSize - 1)
                        place = "Center";
                    else if (w == 0)
                        place = "Entertainment";
                    else if (w == gridSize - 1)
                        place = "Governemnt";
                    newDoor.GetComponent<ExitPos>().setTarget(place);
                }

                if (currentTile != null)
                {
                    if (currentTile != hedgeLat)
                        Instantiate(currentTile, new Vector3(w, h, 0f), Quaternion.identity);
                    else
                        Instantiate(currentTile, new Vector3(w, h, 0f), Quaternion.Euler(0f, 0f, 90f));

                }
            }
        }
    }

    void CloseEdges()
    {
        for (int i = 0; i < 4; i++)
        {
            for (int j = 1; j < gridSize - 1; j++) {
                if (i == 0 && gridKey[0, j] != 'R')
                {
                    gridKey[0, j] = 'h';
                    boardMap[0, j] = 1;
                }
                else if (i == 1 && gridKey[gridSize-1, j] != 'R')
                {
                    gridKey[gridSize-1, j] = 'h';
                    boardMap[gridSize-1, j] = 1;
                }
                else if (i == 2 && gridKey[j, 0] != 'R')
                {
                    gridKey[j, 0] = 'v';
                    boardMap[j, 0] = 1;
                }
                else if (i == 3 && gridKey[j, gridSize - 1] != 'R')
                {
                    gridKey[j, gridSize-1] = 'v';
                    boardMap[j, gridSize-1] = 1;
                }
            }
        }
        gridKey[0, 0] = '7';
        gridKey[0, gridSize - 1] = '9';
        gridKey[gridSize - 1, 0] = '1';
        gridKey[gridSize - 1, gridSize - 1] = '3';

        boardMap[0, 0] = 1;
        boardMap[0, gridSize - 1] = 1;
        boardMap[gridSize - 1, 0] = 1;
        boardMap[gridSize - 1, gridSize - 1] = 1;
    }

